sider changing your PS1 to also show the current branch:","#        PS1='[\\u@\\h \\W$(__git_ps1 \" (%s)\")]\\$ '","#","#       The argument to __git_ps1 will be displayed only if you","#       are currently in a git repository.  The %s token will be","#       the name of the current branch.","#","#       You can also show current changes adding __git_ps1_changes","#       to PS1 close to __git_ps1:","#        ...$(__git_ps1 \" (%s)\")$(__git_ps1_changes \" (%s)\")...","#","#       Example: ▵2 -+3 *1 ?6 means:","#        ▵2 - Your branch is ahead of 'origin/branch' by 2 commits","#        +3 - Your branch has 3 staged changes to be commited","#        *1 - Your branch has 1 unstaged changes to be commited","#        ?6 - Your branch has 6 untracked files","#","# To submit patches:","#","#    *) Read Documentation/SubmittingPatches","#    *) Send all patches to the current maintainer:","#","#       \"Shawn O. Pearce\" <spearce@spearce.org>","#","#    *) Always CC the Git mailing list:","#","#       git@vger.kernel.org","#","","__gitdir ()","{","\tif [ -z \"$1\" ]; then","\t\tif [ -n \"$__git_dir\" ]; then","\t\t\techo \"$__git_dir\"","\t\telif [ -d .git ]; then","\t\t\techo .git","\t\telse","\t\t\tgit rev-parse --git-dir 2>/dev/null","\t\tfi","\telif [ -d \"$1/.git\" ]; then","\t\techo \"$1/.git\"","\telse","\t\techo \"$1\"","\tfi","}","","__git_ps1 ()","{","\tlocal b=\"$(git symbolic-ref HEAD 2>/dev/null)\"","\tif [ -n \"$b\" ]; then","\t\tif [ -n \"$1\" ]; then","\t\t\tprintf \"$1\" \"${b##refs/heads/}\"","\t\telse","\t\t\tprintf \" (%s)\" \"${b##refs/heads/}\"","\t\tfi","\tfi","}","","__git_ps1_changes ()","{","\tlocal b_ref=\"$(git symbolic-ref -q HEAD 2>/dev/null)\";","\tif [ -n \"$b_ref\" ]; then","\t\tlocal b_origin=\"$(git for-each-ref --format='%(upstream:short)' $b_ref)\";","\t\tif [ -n \"$b_origin\" ]; then","\t\t\tlocal b=${b_ref##refs/heads/};","\t\t\tlocal changes=\"\";","\t\t\tlocal unpush=$(git rev-list $b_origin..$b --count);","\t\t\tlocal staged=$(g